def solve():
    s = "t5 t31 t15 t6 t6 t6 t15 t34 t35 t23 t18 t33 t15 t10 t3 t16 t1 t7 t15 t15 t6 t14"

    def generate_grammar(input_string, grammar):
        stack = []
        for token in input_string:
            if token in grammar.keys():
                stack.append(token)
            else:
                if len(stack) > 0:
                    top = stack.pop()
                    if top in grammar.keys():
                        stack.append(top)
                else:
                    return None
        if len(stack) == 0:
            return ""
        return stack

    grammar = {}
    for token in s:
        if token in grammar:
            grammar[token] = grammar[token]
        else:
            grammar[token] = "t"

    generated_string = generate_grammar(s, grammar)

    if generated_string:
        print("Yes")
    else:
        print("No")

solve()
